    public static void subGen(int n, int i, int j, ArrayList<String> list, StringBuilder sb, int count) {
        if (count == n * 2) {
            list.add(sb.toString());
            return;
        }
        if (i < n) {
            sb.append("(");
            subGen(n, i + 1, j, list, sb, count + 1);
            sb.deleteCharAt(count);
        }
        if (i > j) {
            sb.append(")");
            subGen(n, i, j + 1, list, sb, count + 1);
            sb.deleteCharAt(count);
        }
    }


    public static void subGenParenthesis(int n, List<String> list, int count, StringBuilder sb, Stack<Character> stack) {
        if (count > n * 2) {
            return;
        }
        if (count == n * 2) {
            if (stack.isEmpty()) {
                return;
            } else if (stack.peek() == '(') {
                list.add(sb.append(')').toString());
                return;
            }
        }
        count++;
        stack.push('(');
        subGenParenthesis(n, list, count, sb.append('('), stack);
        stack.pop();
        if (!stack.isEmpty() && stack.peek() == '(') {
            stack.pop();
        } else {
            stack.push(')');
        }
        subGenParenthesis(n, list, count, sb.append(')'), stack);

    }

    public static void subGenParenthesis2(int n, List<String> list, int count, StringBuilder sb, int left, int right, Stack<Character> stack) {
        if (left > n || right > n) {
            return;
        }
        if (count == n * 2) {
            if (isValid(sb.append('(').toString())) {
                list.add(sb.toString());
            }
            sb.deleteCharAt(count - 1);
            if (isValid(sb.append(')').toString())) {
                list.add(sb.toString());
            }
            sb.deleteCharAt(count - 1);
            return;
        }
        count++;
        subGenParenthesis2(n, list, count, sb.append('('), left + 1, right, stack);
        sb.deleteCharAt(count - 2);
        subGenParenthesis2(n, list, count, sb.append(')'), left, right + 1, stack);
        sb.deleteCharAt(count - 2);
    }

    public static boolean isValid(String str) {
        Stack<Character> stack = new Stack();
        for (int i = 0; i < str.length(); i++) {
            char ch = str.charAt(i);
            if (ch == '(') {
                stack.push(')');
            } else {
                if (stack.isEmpty()) {
                    return false;
                } else {
                    stack.pop();
                }
            }
        }
        if (stack.isEmpty()) {
            return true;
        }
        return false;
    }


